function App() {
  return (
    <div className="body">
      <div className="navbar">
        <h1> Home </h1>
        <h1> About </h1>
        <h1> Projects</h1>
        <h1> Resume </h1>
        <h1> Contact Me</h1>
      </div>
    </div>
  );
}

export default App;
